import React from "react";

import Ancestors from './components/Ancestors';
import styles from './App.module.css';


const App = () => {
    return (
         <div className={styles.app}>
              <div className={styles.container}>
                    <Ancestors />
               </div>
         </div>  
    )
 }

export default App;
